import { Tabs } from "antd";
const { TabPane } = Tabs;

import Info from "../components/Info";
import LightningEmperor from "../components/monsters/LightningEmperor";
import CowGirl from "../components/monsters/CowGirl";
import Viking from "../components/monsters/Viking";
import WarBear from "../components/monsters/WarBear";
import Glory from "../components/Glory";

function callback(key) {
  console.log(key);
}

const Index = () => {
  return (
    <div className="index">
      <style jsx>{`
        .index {
          padding: 20px;
        }
      `}</style>
      <p>뇌솔드 덱을 만들자</p>
      <div className="info">
        <p>
          '추가' 항목들은 룬강이나 연마, 변환 등을 통해 예상되는 최종 스펙을
          알아보기 위함.
        </p>
        <p>
          {" "}
          (예: 뇌제 공% 연마 2%, 깡공 연마 18 가능 -> 추가 공%에 '2%' 입력, 추가
          깡공에 '18' 입력)
        </p>
        <p> 해당 없거나 현재 스펙 그대로 보기 위해선 모두 '0' 입력</p>
      </div>
      <Tabs defaultActiveKey="1" onChange={callback}>
        <TabPane tab="Info" key="1">
          <Info />
        </TabPane>
        <TabPane tab="Emperor" key="2">
          <LightningEmperor />
        </TabPane>
        <TabPane tab="CowGirl" key="3">
          <CowGirl />
        </TabPane>
        <TabPane tab="Viking" key="4">
          <Viking />
        </TabPane>
        <TabPane tab="WarBear" key="5">
          <WarBear />
        </TabPane>
      </Tabs>
      <Glory />
    </div>
  );
};

export default Index;
